UNISWAP = ''
TETHER = ''
ARBITRUM = ''
SCROLL = ''
PENDLE = ''
MALI = '000063aa5baa5b'


code_hex = PENDLE
code = bytes.fromhex(code_hex)

PUSH1 = 0x60
PUSH32 = 0x7f
INVALID = 0xfe
JUMP = 0x56
JUMPI = 0x57
JUMPDEST = 0x5b

L = len(code)
adj_push_v = None
num_jumpdests = 0
num_jumps = 0
num_jumpis = 0
jump_offsets = []
jumpi_offsets = []
num_mali_bytes = 0
i = 0
while i < L:
    op = code[i]
    if PUSH1 <= op <= PUSH32:
        data_len = op - PUSH1 + 1
        data = code[i + 1:i + data_len + 1]

        p = -1
        while (p := data.find(JUMPDEST, p + 1)) != -1:
            num_mali_bytes += 1
            pos = i + p + 1
            print(f"malicious push byte: {pos} {pos//32} {pos%32}")

        i += data_len + 1
        adj_push_v = int.from_bytes(data, "big")
        # print(f"{data.hex()} {adj_push_v:x}")
        continue

    # if op == INVALID:
    #     print(f"code end at {i} ({i / L})")
    #     break

    if op == JUMPDEST:
        num_jumpdests += 1
    elif op == JUMP:
        num_jumps += 1
        if adj_push_v is not None:
            jump_offsets.append(adj_push_v - i)
    elif op == JUMPI:
        num_jumpis += 1
        if adj_push_v is not None:
            jumpi_offsets.append(adj_push_v - i)

    adj_push_v = None

    i += 1

print(f"code length: {len(code)}")
print(f"num malicious bytes: {num_mali_bytes}  {num_mali_bytes / len(code)}")
print(f"jumpdests:  {num_jumpdests} {num_jumpdests / len(code)}")
print(f"jumps:  {num_jumps} {len(jump_offsets)}")
print(f"jumpis: {num_jumpis} {len(jumpi_offsets)}")

print(f"jump  offsets: {sorted(jump_offsets)}")
print(f"jumpi offsets: {sorted(jumpi_offsets)}")
